import React, { Component, Img } from 'react';
import { Menu, Icon } from 'antd';

const twitter = 'https://twitter.com/thynickylaczko';
const github = 'https://github.com/AsyncNick';

class DivBar extends Component {
  state = {
    current: 'home',
  }
  handleClick = (e) => {
    console.log('click', e)
    this.setState({
      current: e.key,
    })
  }
  render() {
    return  (
        <Menu
        onClick={this.handleClick}
        selectedKeys={[this.state.current]}
        mode="horizontal">
        <Menu.Item key='home'>
          <Icon type=''/> Home
        </Menu.Item>
        <Menu.Item key='twitter'>
          <a target="_blank" href={twitter}><Icon type='twitter'/>Twitter</a>
        </Menu.Item>
        <Menu.Item key='github'>
          <a target="_blank" href={github}><Icon type='github'/> github </a>
        </Menu.Item>

      </Menu>
    )
  }
}

export default DivBar;
